Beleidsdocumenten met betrekking tot responsible disclosure geldig op 1-7-2022 en daarna;
E-mails, conceptversies, aantekeningen die betrekking hebben op dit beleid; 
Evaluaties van dit beleid.

-	Het dossier betreffende de sanering van de tectyleer-inrichting die hier gevestigd is geweest; 
o	Vergunningen, bodemsanering, sanerings-afspraken, milieurapportages hergebruik etc van gebouwen en grond.
-	De afspraken die gemaakt zijn met de vorige eigenaar over het gebruik van de beide kadastrale percelen Korte Bredestraat 8 Nijmegen (inclusief Kadaster informatie); 
o	Beide kadastrale percelen zijn nu samengevoegd tot 1 kadastraal perceel
o	Inclusief de afspraken over de inrichting van de Plak, te weten de ongeveer 36 nieuwbouwhuizen (1986) aan de Lievekamphof, Bredestraat en Korte Bredestraat
-	Het volledige dossier betreffende de nieuw- en verbouw Korte Bredestraat 8 Nijmegen; inclusief adviezen van ODRN, Welstandscommissie, gevraagde en toegekende vergunningen (bouw, kap van bomen, verwijderen 180m2 groen, verwijderen licht vervuilde grond en puin etc. ) , besluiten, beschikkingen etc.

1. de contacten tussen het ministerie (contactpersoon) en de raad (raadsgriffier) voorafgaande aan het besluit d.d. 12 oktober 2022;
2. het archiefexemplaar ontvangstbevestiging (registratienummer E22.001981) van de brief
d.d. 12 oktober 2022;
3. de agendering van brief B11 in besluitronde 30 november 2022 (zie ook artikel 12, eerste
lid, Reglement van Orde 2019).

Woo verzoek gedaan op 1 september 2023 over 1. De dagen waarop de in 2023 in Lindenholt opgebaggerde specie is bemonsterd;
2. De rapportages van alle chemische analyses die op deze monsters zijn uitgevoerd;
3. De overwegingen op grond waarvan is besloten tot afvoeren van de baggerspecie;
4. De gekozen stortlocatie en de overwegingen die tot de keuze daarvan hebben geleid;
5. De hoeveelheden van de uit Lindenholt daadwerkelijk afgevoerde specie;
6. Alle kosten verbonden aan het afvoeren en storten van de onder 5. bedoelde baggerspecie
